import { useState } from 'react';
import './App.css';
import Background from './Components/Background';
import MainBody from './Components/Main Body';
import TopBar from './Components/TopBar';
import {ThemeProvider} from 'styled-components'

function App() {

  const [isItDarkMode, setDarkMode] = useState(false)
  // console.log(classes)


  return (
    <ThemeProvider>
      <Background/>
      <TopBar darkMode={isItDarkMode} setDarkMode={setDarkMode}/>
      <MainBody/>
    </ThemeProvider>
  );
}

export default App;
